-- ----------------------------
-- Table structure for audit_data
-- ----------------------------
DROP TABLE IF EXISTS `audit_data`;
CREATE TABLE `audit_data` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `guid` varchar(64) NOT NULL,
  `domain` varchar(200) NOT NULL,
  `registrar_epp_id` varchar(200) DEFAULT NULL,
  `contact_id` varchar(50) NOT NULL,
  `registered_years` int(11) DEFAULT NULL,
  `registrant_type` enum('企业','个人') NOT NULL DEFAULT '个人',
  `contact_code` int(11) NOT NULL COMMENT '1、身份证号码 2、军官证号码 3、护照代码',
  `contact_value` varchar(64) NOT NULL,
  `organization_type` enum('组织机构代码证','营业执照') NOT NULL,
  `org` varchar(50) DEFAULT NULL,
  `org_code` varchar(20) DEFAULT NULL,
  `tm_expires_date` date DEFAULT NULL,
  `service_start_time` datetime DEFAULT NULL,
  `other_param` varchar(200) DEFAULT NULL,
  `business_license` varchar(50) DEFAULT NULL,
  `id_file` varchar(50) DEFAULT NULL,
  `org_file` varchar(50) DEFAULT NULL,
  `business_file` varchar(50) DEFAULT NULL,
  `other_file` text,
  `registrant_name` varchar(300) DEFAULT NULL,
  `registrant_organization` varchar(300) DEFAULT NULL,
  `parse_url` varchar(100) DEFAULT NULL,
  `trademark_reg_no` varchar(50) DEFAULT NULL,
  `tm_class_type` varchar(200) DEFAULT NULL,
  `tm_issuing_country` varchar(4) DEFAULT NULL,
  `domain_agent` varchar(200) DEFAULT NULL,
  `domain_agent_tel` varchar(50) DEFAULT NULL,
  `domain_agent_mobile` varchar(20) DEFAULT NULL,
  `domain_agent_email` varchar(200) DEFAULT NULL,
  `domain_agent_address` varchar(300) DEFAULT NULL,
  `audit_category` enum('初审','复审') NOT NULL DEFAULT '初审',
  `audit_result` enum('待审核','审核中','审核拒绝','审核退回','审核通过','已删除') NOT NULL DEFAULT '待审核',
  `audit_time` datetime DEFAULT NULL,
  `audit_when` datetime DEFAULT NULL,
  `audit_user_id` int(11) DEFAULT NULL,
  `fee` decimal(10,2) DEFAULT NULL,
  `display_reason` varchar(500) DEFAULT NULL,
  `need_feedback` enum('是','否') NOT NULL DEFAULT '是',
  `feedback_status` varchar(100) DEFAULT '',
  `contact_update` datetime DEFAULT NULL,
  `contact_update_flag` enum('是','否') NOT NULL DEFAULT '是',
  `update_flag` enum('是','否') NOT NULL DEFAULT '是',
  `update_count` int(11) NOT NULL DEFAULT '0',
  `whois_update` enum('是','否') NOT NULL DEFAULT '否',
  `is_main` enum('是','否') NOT NULL DEFAULT '否',
  `reject_reason_id` int(11) DEFAULT NULL,
  `operator_id` int(11) NOT NULL,
  `registrar_id` int(11) NOT NULL,
  `issue_id` varchar(50) DEFAULT NULL,
  `created` datetime NOT NULL,
  `modified` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=43 DEFAULT CHARSET=utf8;

