-- ----------------------------
DROP TABLE IF EXISTS `registry_user`;
CREATE TABLE `registry_user` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `guid` varchar(100) NOT NULL,
  `email` varchar(200) DEFAULT NULL,
  `password` varchar(64) DEFAULT NULL,
  `salt` varchar(8) DEFAULT NULL,
  `cellphone` varchar(15) DEFAULT NULL,
  `phone` varchar(50) DEFAULT NULL,
  `qq` varchar(20) DEFAULT NULL,
  `skype` varchar(50) DEFAULT NULL,
  `wechat` varchar(50) DEFAULT NULL,
  `backup_email` varchar(200) DEFAULT NULL,
  `last_name` varchar(50) DEFAULT NULL,
  `first_name` varchar(50) DEFAULT NULL,
  `title` varchar(50) DEFAULT NULL,
  `gender` enum('先生','女士') DEFAULT '先生',
  `last_login_time` datetime DEFAULT NULL,
  `last_login_ip` varchar(15) DEFAULT NULL,
  `login_count` int(11) DEFAULT '0',
  `status` enum('正常','挂起','待审核','审核中','待激活') DEFAULT '正常',
  `audit_scope` varchar(200) DEFAULT NULL,
  `manage_type` enum('注册商方式','代理商方式') NOT NULL DEFAULT '注册商方式',
  `deleted` enum('是','否') DEFAULT '否',
  `user_role` int(11) DEFAULT '0',
  `ip_limit_flag` enum('是','否') DEFAULT '否',
  `ip_limit` varchar(15) DEFAULT NULL,
  `operator_id` int(11) NOT NULL,
  `created` datetime NOT NULL,
  `modified` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=102 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of registry_user
-- ----------------------------

-- ----------------------------
-- Table structure for review_config
-- ----------------------------
DROP TABLE IF EXISTS `review_config`;
CREATE TABLE `review_config` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `strategy` enum('按终端客户ID','按是否需要回访标记','按联系人识别码','按注册商ID','全部') NOT NULL DEFAULT '全部',
  `detail` varchar(250) NOT NULL,
  `treatment` enum('无需回访直接不通过','无需回访直接通过','需回访') NOT NULL DEFAULT '需回访',
  `status` enum('有效','无效') NOT NULL DEFAULT '有效',
  `created` datetime NOT NULL,
  `modified` datetime NOT NULL,
  `operator_id` int(11) NOT NULL,
  `guid` varchar(50) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of review_config
-- ----------------------------

-- ----------------------------
-- Table structure for trademark
-- ----------------------------
DROP TABLE IF EXISTS `trademark`;
CREATE TABLE `trademark` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `guid` varchar(100) NOT NULL,
  `domain_name` varchar(500) NOT NULL,
  `registrant_type` enum('企业','个人') NOT NULL DEFAULT '个人',
  `trademark_name` varchar(200) NOT NULL,
  `trademark_registration_number` varchar(50) NOT NULL,
  `trademark_registration_type` enum('商标注册证书','商标受理通知书') NOT NULL DEFAULT '商标注册证书',
  `organization_type` enum('组织机构代码证','营业执照') NOT NULL DEFAULT '营业执照',
  `organization_code` varchar(16) DEFAULT NULL,
  `organization_number` varchar(64) DEFAULT NULL,
  `country` varchar(20) NOT NULL,
  `start_date` date NOT NULL,
  `end_date` date DEFAULT NULL,
  `trademark_certificate_copy` varchar(100) NOT NULL,
  `id_card_copy` varchar(100) DEFAULT NULL,
  `business_license` varchar(100) DEFAULT NULL,
  `give_intro_proof` varchar(100) DEFAULT NULL COMMENT '域名赠送说明',
  `trademark_alternation_proof` varchar(100) DEFAULT NULL,
  `trademark_extension_proof` varchar(100) DEFAULT NULL,
  `type` enum('域名注册','受通转正','变体激活','赠送') NOT NULL DEFAULT '域名注册',
  `lang_type` enum('en','cn') NOT NULL DEFAULT 'cn',
  `operator_id` int(11) NOT NULL,
  `registrar_id` int(11) NOT NULL,
  `created` datetime NOT NULL,
  `modified` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of trademark
-- ----------------------------

-- ----------------------------
-- Table structure for upload_file
-- ----------------------------
DROP TABLE IF EXISTS `upload_file`;
CREATE TABLE `upload_file` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `guid` varchar(64) NOT NULL,
  `filename` varchar(500) NOT NULL,
  `filetype` varchar(50) NOT NULL,
  `original_filename` varchar(250) NOT NULL,
  `upload_role` enum('注册局','注册商') NOT NULL,
  `company_id` int(11) NOT NULL,
  `user_id` int(11) NOT NULL,
  `ip` varchar(15) NOT NULL,
  `created` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=260 DEFAULT CHARSET=utf8;

